import React from 'react';
import './header.css'

// children
const Header = ({setContent}) => {
    return ( 
        <header>
            <nav>
                <a href="#" onClick={() => setContent('Monsters')}>MONSTERS</a>
                <a href="#" onClick={() => setContent('Equipments')}>EQUIPMENTS</a>
                <a href="#">CREATURES</a>
                <a href="#">INGREDIENTS</a>
            </nav>
        </header>
    );
}

export default Header;
